jQuery(".faq-item ").each(function(){
		jQuery(this).children(".panel").css('height', function(){ 
			 return jQuery(this).height(); 
		});
		if(jQuery(this).index() > 0){
			/* jQuery(this).children(".panel").css('display','none'); */
		}else{
			jQuery(this).find(".toggle-open").addClass('active');
		}
		jQuery(this).children(".accordion").bind("click", function(){
			jQuery(this).children().addClass(function(){
				if(jQuery(this).hasClass("active")) return "";
				return "active";
			});
			jQuery(this).siblings(".panel").slideToggle();
          jQuery(this).toggleClass("active");
			// jQuery(this).parent().siblings(".faq-item").children(".panel").slideUp();
			jQuery(this).parent().siblings(".faq-item").find(".active").removeClass("active");
		});
	});